#!/usr/bin/perl

use File::Basename;
use File::Spec;

my $version = "1.11.91-SNAPSHOT";
my %files = ();
my @mavenfiles = qw( maven-metadata-local.xml _maven.repositories resolver-status.properties maven-metadata-archiva.default.xml maven-metadata-archiva.default.xml.sha1 );

while(<DATA>) {
  #print;
  next if (/^\s*$/);
  chomp;
  my $path = $_;
  unlink $path if -f $path;
  printf "rm %s\n", $path;

  $files{ $path } = 1;
  my($filename, $directories, $suffix) = fileparse($path);
  $directories =~ s|/$||;

  if (!exists $files{ $directories } && -d $directories) {
    printf "# checking files in %s\n", $directories;
    my $found_files = 0;
    foreach my $mavenfile ( @mavenfiles ) {
      my $mavenpath = File::Spec->catfile($directories, $mavenfile);
      unlink $mavenpath if -f $mavenpath;
      printf "rm %s\n", $mavenpath;

      $files{ $mavenpath } = 1;
      $found_files++;
    }
    $files{ $directories } = 1 if ($found_files);
    #rmdir $directories;

    my($dirname, $dirparent, $suffix) = fileparse($directories);
    $dirparent =~ s|/$||;
    if (!exists $files{ $dirparent }) {
      $found_files = 0;
      if ($dirname eq $version) {
        foreach my $mavenfile ( @mavenfiles ) {
          my $mavenpath = File::Spec->catfile($dirparent, $mavenfile);
          unlink $mavenpath if -f $mavenpath;
          printf "rm %s\n", $mavenpath;

          $files{ $mavenpath } = 1;
          $found_files++;
        }
      }
      $files{ $dirname } = 1 if ($found_files);
    }
    #rmdir $dirparent;
  }
}
close(DATA);

if (0) {
open(LIST, "find /itch/maven/repository/org/opennms -type f|");
while(<LIST>) {
  chomp;
  next if exists $files{$_};
  printf "# %s\n", $_;
  $files{ $_ } = 0;
}
close(LIST);
}

exit(0);

